import React from 'react'
import styled from 'styled-components'
import Section from './Section'
import s from '/images/m'

function Home() {
  return (
    <Container>
        <Section/>
        <img src={s}/>
    </Container>
  )
}

export default Home

const Container = styled.div`
    height: 100vh;
`
